import React from 'react';
import './App.css';
import Footer from './Footer';

function Product() {
    
    return (

    <div>
        <div className="card">
            <div className="top">
                <h2 className="name">{props.name}</h2>
                <Avatar img={props.img} />
            </div>
            <div className="bottom">
                <Detail detailInfo={props.tel} />
                <Detail detailInfo={props.email} />
            </div>
        </div>
        <Footer /> 
    </div>

    );
}

export default Product;
